import PropTypes from "prop-types";
import styles from "./03_information.css";

const Informations = ({ className = "" }) => {
  return (
    <div className={[styles.rectangleParent, className].join(" ")}>
      <div className={styles.frameChild} />
      <img
        className={styles.frameItem}
        loading="lazy"
        alt=""
        src="/vector-1.svg"
      />
      <img
        className={styles.frameInner}
        loading="lazy"
        alt=""
        src="/vector-1.svg"
      />
      <img
        className={styles.vectorIcon}
        loading="lazy"
        alt=""
        src="/vector-1.svg"
      />
      <img
        className={styles.frameChild1}
        loading="lazy"
        alt=""
        src="/vector-1.svg"
      />
      <h3 className={styles.information}>information</h3>
      <div className={styles.xxxxHogeHoge}>2025/xx/xx hoge hoge hoge</div>
      <div className={styles.xxxxPiyoPiyo}>2025/xx/xx piyo piyo piyo</div>
      <div className={styles.xxxxFugaFuga}>2025/xx/xx fuga fuga fuga</div>
      <div className={styles.xxxxTakashima}>2025/xx/xx takashima</div>
      <img
        className={styles.image1Icon}
        loading="lazy"
        alt=""
        src="/image-1@2x.png"
      />
    </div>
  );
};

Informations.propTypes = {
  className: PropTypes.string,
};

export default Informations;
